/* Function  structure for function  `bayar_terakhir` */

/*!50003 DROP FUNCTION IF EXISTS `bayar_terakhir` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `bayar_terakhir`(vnpwp VARCHAR(100)) RETURNS date
BEGIN
    
	DECLARE i INT;
	DECLARE res DATE;
	SELECT COUNT(kd_trx) INTO i FROM tb_transaksi WHERE npwp=vnpwp;
	IF i >0 THEN 
		SELECT tanggal_insert INTO res FROM tb_transaksi WHERE npwp=vnpwp ORDER BY tanggal_insert DESC LIMIT 1;
	ELSE
		SET res=NULL;
	END IF;
	RETURN res;
    END */$$
DELIMITER ;

/* Function  structure for function  `bayar_terakhir_baru` */

/*!50003 DROP FUNCTION IF EXISTS `bayar_terakhir_baru` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `bayar_terakhir_baru`(vnpwp VARCHAR(100)) RETURNS date
BEGIN
    
	DECLARE i INT;
	DECLARE res DATE;
	SELECT COUNT(id) INTO i FROM tb_transaksi_dept WHERE npwpd=vnpwp;
	IF i >0 THEN 
		SELECT tgl_transaksi INTO res FROM tb_transaksi_dept WHERE npwpd=vnpwp ORDER BY tgl_transaksi DESC LIMIT 1;
	ELSE
		SET res=NULL;
	END IF;
	RETURN res;
    END */$$
DELIMITER ;

